-- Alte Tabellen löschen, wenn sie schon vorhanden sind.
DROP TABLE ABTEILUNGEN CASCADE CONSTRAINTS;
DROP TABLE GESCHLECHTER CASCADE CONSTRAINTS;
DROP TABLE KLASSEN CASCADE CONSTRAINTS;
DROP TABLE LEHRER CASCADE CONSTRAINTS;
DROP TABLE RELIGIONEN CASCADE CONSTRAINTS;
DROP TABLE SCHUELER CASCADE CONSTRAINTS;
DROP TABLE SCHULJAHRE CASCADE CONSTRAINTS;
DROP TABLE STAATEN CASCADE CONSTRAINTS;

-- Tabellen und die Primärschlüssel erstellen
CREATE TABLE ABTEILUNGEN (
    ABT_ID NUMBER(10,0), 
    ABT_NR VARCHAR2(255 CHAR), 
    ABT_NAME VARCHAR2(255 CHAR), 
    ABT_LEITER VARCHAR2(50 CHAR),
    CONSTRAINT abteilungen_pk PRIMARY KEY (ABT_ID)
);

CREATE TABLE GESCHLECHTER (   
    GES_ID NUMBER(10,0), 
    GES_MW VARCHAR2(10 CHAR), 
    GES_MAENNLICHWEIBLICH VARCHAR2(50 CHAR), 
    GES_SCHUELERSCHUELERIN VARCHAR2(255 CHAR), 
    GES_LEHRERLEHRERIN VARCHAR2(255 CHAR),
    CONSTRAINT geschlechter_pk PRIMARY KEY (GES_ID)    
);

CREATE TABLE KLASSEN (    
    K_NR VARCHAR2(50 CHAR), 
    K_JAHRSEM NUMBER(10,0), 
    K_NREXTERN VARCHAR2(255 CHAR), 
    K_VORSTAND VARCHAR2(50 CHAR), 
    K_ABTEILUNG NUMBER(10,0), 
    K_DATUMVON DATE, 
    K_DATUMBIS DATE,
    CONSTRAINT klassen_pk PRIMARY KEY (K_NR) 
);

CREATE TABLE LEHRER (
    L_NR VARCHAR2(50 CHAR), 
    L_ZUNAME VARCHAR2(255 CHAR), 
    L_VORNAME VARCHAR2(255 CHAR), 
    L_TITEL VARCHAR2(255 CHAR), 
    L_TITELNACH VARCHAR2(255 CHAR), 
    L_GESCHLECHT NUMBER(10,0), 
    L_SPRECHSTUNDE_TAG VARCHAR2(255 CHAR), 
    L_GEHALT NUMBER(38,2), 
    L_STUNDENGEWUENSCHT NUMBER(38,2), 
    L_STUNDENGEHALTEN NUMBER(38,2),
    CONSTRAINT lehrer_pk PRIMARY KEY (L_NR) 
);

CREATE TABLE RELIGIONEN ( 
    REL_ID NUMBER(10,0), 
    REL_NR VARCHAR2(50 CHAR), 
    REL_NAME VARCHAR2(255 CHAR), 
    REL_GESETZLICHANERKANNT NUMBER(10,0), 
    REL_STAATLICHEINGETRAGEN NUMBER(10,0),
    CONSTRAINT religionen_pk PRIMARY KEY (REL_ID) 
);

CREATE TABLE SCHUELER (
    S_NR NUMBER(10,0), 
    S_ZUNAME VARCHAR2(255 CHAR), 
    S_VORNAME VARCHAR2(255 CHAR), 
    S_GESCHLECHT NUMBER(10,0), 
    S_GEBDATUM DATE, 
    S_STRASSE VARCHAR2(255 CHAR), 
    S_HAUSNUMMER VARCHAR2(255 CHAR), 
    S_POSTLEITZAHL NUMBER(10,0), 
    S_POSTORT VARCHAR2(255 CHAR), 
    S_RELIGION NUMBER(10,0), 
    S_STAATSBUERGERSCHAFT VARCHAR2(15 CHAR), 
    S_KLASSE VARCHAR2(255 CHAR),
    CONSTRAINT schueler_pk PRIMARY KEY (S_NR) 
);

CREATE TABLE SCHULJAHRE (
    SJA_NR NUMBER(10,0), 
    SJA_BEZEICHNUNG VARCHAR2(255 CHAR), 
    SJA_BEZEICHNUNGKURZ VARCHAR2(255 CHAR), 
    SJA_BEZEICHNUNGLANG VARCHAR2(255 CHAR), 
    SJA_DATUMVON DATE, 
    SJA_DATUMBIS DATE,
    CONSTRAINT schuljahre_pk PRIMARY KEY (SJA_NR) 
);

CREATE TABLE STAATEN (
    STA_NR VARCHAR2(25 CHAR), 
    STA_NAME VARCHAR2(255 CHAR), 
    STA_STAATSB VARCHAR2(255 CHAR), 
    STA_EULAND VARCHAR2(255 CHAR),
    CONSTRAINT staaten_pk PRIMARY KEY (STA_NR) 
);

