-- Die Fremdschlüssel erstellen
ALTER TABLE ABTEILUNGEN
ADD CONSTRAINT fk_abteilungen_lehrer
  FOREIGN KEY (ABT_LEITER)
  REFERENCES LEHRER(L_NR);

ALTER TABLE KLASSEN
ADD CONSTRAINT fk_klassen_schuljahre
  FOREIGN KEY (K_JAHRSEM)
  REFERENCES SCHULJAHRE(SJA_NR);

ALTER TABLE KLASSEN
ADD CONSTRAINT fk_klassen_lehrer
  FOREIGN KEY (K_VORSTAND)
  REFERENCES LEHRER(L_NR);

ALTER TABLE KLASSEN
ADD CONSTRAINT fk_klassen_abteilung
  FOREIGN KEY (K_ABTEILUNG)
  REFERENCES ABTEILUNGEN(ABT_ID);

ALTER TABLE LEHRER
ADD CONSTRAINT fk_lehrer_geschlecht
  FOREIGN KEY (L_GESCHLECHT)
  REFERENCES GESCHLECHTER(GES_ID);

ALTER TABLE SCHUELER
ADD CONSTRAINT fk_schueler_geschlecht
  FOREIGN KEY (S_GESCHLECHT)
  REFERENCES GESCHLECHTER(GES_ID);  

ALTER TABLE SCHUELER
ADD CONSTRAINT fk_schueler_religion
  FOREIGN KEY (S_RELIGION)
  REFERENCES RELIGIONEN(REL_ID);  

ALTER TABLE SCHUELER
ADD CONSTRAINT fk_schueler_staaten
  FOREIGN KEY (S_STAATSBUERGERSCHAFT)
  REFERENCES STAATEN(STA_NR);  

ALTER TABLE SCHUELER
ADD CONSTRAINT fk_schueler_klassen
  FOREIGN KEY (S_Klasse)
  REFERENCES KLASSEN(K_NR);  

COMMIT;

-- Die Kontrollausgaben erzeugen 
SELECT COUNT(*) AS SchuelerAnzahl FROM SCHUELER;
SELECT COUNT(*) AS LehrerAnzahl FROM LEHRER;
SELECT COUNT(*) AS KlassenAnzahl FROM KLASSEN;